"use strict";

const { Counter } = require('collections');
function f_gold(s) {
    const counter = new Counter(s);
    const cnt = Array(10).fill(0);
    cnt[0] = counter.get('z');
    cnt[2] = counter.get('w');
    cnt[4] = counter.get('u');
    cnt[6] = counter.get('x');
    cnt[8] = counter.get('g');
    cnt[3] = counter.get('h') - cnt[8];
    cnt[5] = counter.get('f') - cnt[4];
    cnt[7] = counter.get('s') - cnt[6];
    cnt[1] = counter.get('o') - cnt[0] - cnt[2] - cnt[4];
    cnt[9] = counter.get('i') - cnt[5] - cnt[6] - cnt[8];
    return cnt.map((val, i) => val.toString().repeat(i)).join('');
}
